import './Dashboard.css'
import React, { useState } from 'react'
import {
  Link,
  useNavigate,
  useLocation,
  Navigate,
  useParams,
} from 'react-router-dom'
import { Dialog } from '@mui/material'
const Note = ({ note, Outlet }) => {
  const location = useLocation()
  const { id } = useParams()
  const navigate = useNavigate()
  const [display, setDisplay] = useState(false)
  // const onNoteClick = (id) => {
  //   console.log(location)
  //   // <Link to={`/${id}`} />
  //   console.log(_id)
  //   // navigate(`/api/dashboard/notes/${id}`, { state: { background: location } })
  //   // navigate(`/api/dashboard/notes/${id}`)
  // }
  const openOutlet = () => {
    setDisplay(!display)
  }
  return (
    // <div className='note-container' onClick={(e) => onNoteClick(_id)}>
    <div className='note-container'>
      <div
        style={{
          width: '200px',
          height: '100px',
          backgroundColor: '#FAFAFA',
          padding: '10px',
        }}
        onClick={openOutlet}
      >
        <h4>Use useEffect in Note.js coasmponent</h4>
        Displaying the id : {id}
      </div>
      {display && <div style={{display:'flex', justifyContent:'center', alignItems:'center',}}>{Outlet}</div>}
    </div>
  )
}

export default Note
